INSERT INTO `speciality` VALUES (1,'Asthma Specialist ','Treats asthama related disorders','An allergist is a pediatrician or internist who has taken additional training to qualify as a specialist in allergy and immunology. An allergist specializes in allergies, asthma, and allergic asthma'),(2,'Cardiologist','Treats heart deseases','Cardiologists are doctors who specialize in diagnosing and treating diseases or conditions of the heart and blood vessels.the cardiovascular system'),(3,'Dermatologist','Treats skin diseases','Dermatology is the branch of medicine dealing with the hair, nails, skin and its diseases. It is a specialty with both medical and surgical aspects. A Dermatologist treats diseases, in the widest sense, and some cosmetic problems of the skin, scalp, hair, and nails'),(4,'Gastroenterologist','Treats stomach disorders','A Gastroenterologist is a physician with dedicated training and unique experience in the management of diseases of the gastrointestinal tract and liver'),(5,'Neurologist','Treats Nervous System disorders.','Neurology is the branch of medicine concerned with the study and treatment of disorders of the nervous system. The nervous system is a complex, sophisticated system that regulates and coordinates body activities. A neurologist studies and treats any such disorders.'),(6,'Gynecologist','Treats diseases of the female reproductive system ','A Gynecologist deals with health care for women, especially the diagnosis and treatment of disorders affecting the female reproductive system.'),(7,'Obstetrician/Gynecologist ','Treats dissorders during pregnancy and childbirth','A Obstetrician cum Gynecologist  are doctors dealing with the female reproductive organs in their pregnant and non-pregnant state,respectively, and as such are often combined to form a single medical specialty'),(8,'Orthopaedic Surgeon','Treats Bones and Muscles dissorders.','Orthopedics is the branch ofsurgery concerned with conditions involving the musculoskeletal system. Orthopaedic surgeons use both surgical and nonsurgical means to treat musculoskeletal trauma, sports injuries, degenerative diseases, infections, tumors, and congenital disorders.'),(9,'Pediatrician','Treats infants, toddlers, children and teenagers.','Pediatrics  is the branch of medicine that deals with the medical care ofinfants, children, and adolescents, and the age limit usually ranges from birth up to 18 years of age. A medical practitioner who specializes in this area is known as a Pediatrician.'),(10,'Psychiatrist','Treats patients with mental and emotional disorders.',' A psychiatrist specializes in the diagnosis and treatment of mental disorders. Psychiatrists are medical doctors who must evaluate patients to determine whether their symptoms are the result of a physical illness, a combination of physical and mental, or a strictly psychiatric one'),(11,'Dentist ','Treats dental health and mouth problems','A dentist, also known as a dental surgeon, is a health care practitioner who specializes in the diagnosis, prevention, and treatment of diseases and conditions of the oral cavity.'),(12,'Dietician/Nutritionist','Food or Nourishment.','Dietitian and Nutritionists are the food and nutrition experts who can translate the science of nutrition into practical solutions for healthy living.'),(13,'Ear-nose-throat specialist','Treats conditions relating to Ear, Nose & Throat only','ENT specialists are Doctors who deal with disorders and conditions of the ear, nose, and throat (ENT) region, and related areas of the head and neck. '),(14,'General Physician ','Treats conditions associated with family health','A general practitioner manages types of illness that present in an undifferentiated way at an early stage of development, which may require urgent intervention. Their duties are not confined to specific organs of the body, and they have particular skills in treating people with multiple health issues. '),(15,'Homeopathy','Treated doses of natural substances','Homeopathy is a form of alternative medicine created in 1796 by Samuel Hahnemann based on his doctrine of like cures like (similia similibus curentur), whereby a substance that causes the symptoms of a disease in healthy people will cure similar symptoms in sick people. Homeopath is a doctor specializing in this science.'),(16,'Veterinarian ','Treats different diseases of the animal world','A veterinary physician, colloquially called a vet, is a professional who practices veterinary medicine by treating disease, disorder, and injury in non-human animals'),(17,'Lactation Consultant ','Specializes in the clinical management of breastfeeding','A lactation consultant is an allied health professional who specializes in the clinical management of breastfeeding. Lactation consultants commonly work in hospitals, physician or midwife practices, public health programs, and private practice.'),(18,'Ayurvedic Doctor ','Treats with ancient medical science','Ayurvedic medicine is a system of Hindu traditional medicine native to the Indian subcontinent. Practices derived from Ayurvedic traditions are a type of alternative medicine. Ayurveda is a discipline of the upaveda or \"auxiliary knowledge\" in Vedic tradition. The origins of Ayurveda are also found in the Atharvaveda, which contains 114 hymns and incantations described as magical cures for disease.Ayurvedic Doctors practice the above branch of medicine');
/*!40000 ALTER TABLE `speciality` ENABLE KEYS */;
